[laravel-batch.loc]

aliases           = www.{host} laravel-batch.loc
enabled           = on
environment       = System
http_port         = 80
https_port        = 443
ip                = auto
nginx_engine      = Nginx-1.27
node_engine       =
php_engine        = PHP-8.2-FCGI
project_dir       = {base_dir}
project_url       = {host_scheme}://{host_decoded}{scheme_port}
public_dir        = {base_dir}\public
ssl               = on
ssl_cert_file     = auto
ssl_key_file      = auto
start_command     =
terminal_codepage = 65001
